(332, '2019-02-02 06:45:09', 111, 1, 'pgrw_ut_form_control', 112, 'ut_form_control', 1, '{\"nombre_evaluador\":\"Andr\\u00e9s Felipe Osorio Pelaez\",\"id_modelo\":\"00000000112\",\"centro_de_costos\":\"26\",\"AgilidadTeclado\":\"2\",\"Ob_AgilidadTeclado\":\"Esta modelo no es buena en digitaci\\u00f3n, requiere mucho apoyo en la parte  de escritura, se debe apoyar demasido para que mejore esta aspecto\",\"usoComandos\":\"8\",\"usoRecursosNavegador\":\"10\",\"calidadImagen\":\"10\",\"identificacionErrores\":\"8\",\"conversacionesSinTraductor\":\"4\",\"Ob_conversacionesSinTraductor\":\"No maneja expresiones sencillas, se debe ense\\u00f1ar muy especialmente jerga webcam.\",\"usoTraductor\":\"10\",\"calidadTraducciones\":\"10\",\"conocimientoJerga\":\"4\",\"Ob_conocimientoJerga\":\"Modelo desconoce muchas de las palabras que se utilizan en este campo.\",\"conocimientopalabrasTecnicas\":\"10\",\"estadoCabello\":\"8\",\"Ob_estadoCabello\":\"Esta modelo siempre llega en muy buenas condiciones para transmitir, es muy ordenada en este aspecto. Su cabello siempre est\\u00e1 en perfecto estado.\",\"estadoUnas\":\"10\",\"calidadMaquillaje\":\"10\",\"usoLenceriaAdecuada\":\"10\",\"OrganizacionRom\":\"10\",\"NoSeDistraeConDispositivos\":\"10\",\"UsaEspanolCuandoEsNesc\":\"10\",\"NoJergaLatinaTraduccion\":\"10\",\"ManejoPlataforma\":\"10\",\"MovimientosCamara\":\"10\",\"DesarrolloShow\":\"10\",\"CalidadUsoJuguetes\":\"10\",\"publicaTopics\":\"8\",\"EstructuraTopic\":\"3\",\"CoherenciaRedaccionTopic\":\"10\",\"RelTopicShow\":\"10\",\"ExpresionAlegria\":\"2\",\"Ob_ExpresionAlegria\":\"Se muestra muy seria en c\\u00e1mara, se debe capacitar m\\u00e1s en este tema\",\"Gesticulacion\":\"10\",\"CordinacionMotriz\":\"10\",\"Postura\":\"10\",\"Interaccion\":\"8\",\"CalidadBaile\":\"7\",\"Astucia\":\"10\",\"CapacidadesSexuales\":\"7\",\"InterpretacionRol\":\"9\",\"Ortografia\":\"10\",\"Regionalismos\":\"10\",\"CoherenciaConversacion\":\"10\",\"FluidezConversacion\":\"10\",\"Desnudo\":\"8\",\"CalidadStriptease\":\"7\",\"CalidadShow\":\"8\",\"SensualidadMovimientos\":\"9\",\"total_respuestas\":\"370\",\"Recomendaciones\":\"Muy buena modelo en general, considero que tiene un gran potencial, perfila ser m\\u00e1s modelo de FREE que de PVT, se recomienda apertura en este segmento, debe mejorar mucho en aspectos t\\u00e9cnicos, sin embargo en actitud es excelente. \",\"imagenes\":[],\"responsable\":\"Andr\\u00e9s Felipe Osorio Pelaez\",\"tipo_documento\":\"42\",\"fecha\":\"2019-02-02 06:45:09\"}'),
